import Leaflet from 'leaflet'
import React, { StrictMode } from 'react'
import Map from './Map.js'
import Search from './components/search.js'
import './App.css';


function App() {
  return (
    <div className="App">
      <Map>
        <Search/>
      </Map>
    </div>
  );
}

export default App;
